function sortRes(map){
	var arr = [];
	$.each(map, function(key, value){
		arr.push({key:key,value:value});
	});
	arr = arr.sort(function(a, b){
		return b.value - a.value;
	});
	arr = arr.slice(0, 20);
	return arr;
}

