function now(){
	  //这里是定义了时间问题，默认取最近的一周时间
     var date = new Date();
     var year = date.getFullYear();
     var month = date.getMonth()+1;
     var day = date.getDate();
     var hour = date.getHours();
     var minute = date.getMinutes();
     var second = date.getSeconds();
      if(Number(month)<10){
        month="0"+month;
     }
     if(Number(day)<10){
        day = "0"+day
     }
     if (Number(hour)<10) {
     	hour = "0" +hour
     }
     if(Number(minute)<10){
     	minute = "0"+minute
     }
     if (Number(second)<10) {
     	second = "0"+second
     }
     var noww= year+'-'+month+'-'+day+' '+hour+':'+minute+':'+second
     return noww
    //$("#ry_endTime").val(noww);
     
}
function lastweek(){
	 var date = new Date();
	 var dates = new Date(date.getTime()-7*24*3600*1000);
	  var year = date.getFullYear();
     var month = dates.getMonth()+1;
     var day = dates.getDate();
     var hour = dates.getHours();
     var minute = dates.getMinutes();
     var second = dates.getSeconds();
     if(Number(month)<10){
        month="0"+month;
     }
     if(Number(day)<10){
        day = "0"+day
     }
      if (Number(hour)<10) {
     	hour = "0" +hour
     }
     var sec = year+'-'+month+'-'+day+' '+'00:00:00';
     return sec;
};
